  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a 1972 voyage in
  the Aleutian archipelago to locate prehistoric and historic archeological sites.
  The report centers on the problems encountered during the survey, a brief description
  of collections made, recommendations for future site surveying, and an island-by-island
  listing of sites located during this study and by previous researchers. Part II
  presents a chronological account of human occupation in the chain and describes
  the contributions to knowledge of pre-history made by archaeologists in the past.\",\n\t\"license_title\":
